import React, { Component } from 'react';
import Add_team from './Add_team';
import '../../App.css';

export default class Not_member extends Component {
    constructor(props) {
        super(props);
        this.state = {
           create: true
        }
     }

    render() {
        return(
            this.state.login ? //if login is true
               <Add_team
                  onClick={this.onClick.bind(this)}
               />
            : //else
               <Add_team
                  onClick={this.onClick.bind(this)}
               />
         )
    }
}
